Step-by-step reasoning:
1. Key psychological mechanisms: Responders are sensitive to fairness. They internally compare the offered split (split_self) to a norm or reference share based on their token contribution relative to the joint earnings (fair share r). This comparison may be best captured in relative (percentage) terms, consistent with past research showing diminishing sensitivity to percentage deviations.
2. Mechanism interaction: When the offered share deviates from the fair share, a penalty is incurred. A logarithmic (i.e., disproportional) penalty function is used to capture diminishing sensitivity: small differences are penalized less while larger differences incur a stronger penalty.
3. Mathematical formulation: Define r = combined_earning × (token_self/(token_self+token_opp)) as the fair share. Compute a relative deviation error as the absolute difference normalized by this benchmark. Then, the utility of accepting becomes a function of the offered split adjusted by both a baseline (mu) and a penalty term.
4. Parameters: Two learnable parameters are used. mu is a baseline bias, and lambda_param scales the extent to which deviations (in a relative logarithmic form) diminish the utility.
5. Observable behavior: The model maps observable variables (combined_earning, token_self, token_opp, and split_self) into a computed utility. A positive utility indicates acceptance is favorable while a negative utility suggests rejection.

The final model is given below.

<MODEL>
Let r = combined_earning * (token_self / (token_self + token_opp))
Let error = |split_self - r| / r
U = mu + split_self - lambda_param * ln(1 + error)
</MODEL>

