def simulate_model(trial_data, mu=0, lambda_param=1):
    utility_values = []
    for trial in trial_data:
        combined_earning = trial.get("combined_earning", 0)
        token_self = trial.get("token_self", 0)
        token_opp = trial.get("token_opp", 0)
        split_self = trial.get("split_self", 0)

        if (token_self + token_opp) == 0:
            r = 0  #Handle division by zero
            error = 0
        else:
            r = combined_earning * (token_self / (token_self + token_opp))
            if r == 0:
                error = 0 #Handle division by zero
            else:
                error = abs(split_self - r) / r

        if error == 0:
          utility = mu + split_self
        elif error < 0:
          utility = float('-inf') # handle negative error values.  Should not happen but to be safe
        else:
          utility = mu + split_self - lambda_param * math.log(1 + error)

        utility_values.append(utility)
    return utility_values
